import React from 'react';
import './App.css';

const ConferenceItem = ({ book }) => {
  return (
    <div>
      <img alt="" src={require(book.image)} />
      <div class="info">
        <div class="title">{ book.name }</div>
        <div class="desc"><a href="books/4.html">An incredible book about incredible things that you should definitely read.</a></div>
      </div>
    </div>
  );
}

export default ConferenceItem;
